		return (
			<div classtyle={{ postion: 'relative' }}>
			<div style={{ position: 'absolute', top: '0', left: '0' }}>
				{this.state.question ? (
					<QuestionDisplay q={this.props.q} unit={this.props.unit} />
				) : (
					''
				)}
			</div>
			<div className="exiter" style={{ position: 'absolute', top: '0', left: '0' }}>
				{this.state.question ? (
					<QuestionDisplay q={this.state.question.q} unit={this.state.question.unit} />
				) : (
					''
				)}
			</div>
		</div>
		);
	}
}

export default QuestionHolder;
